//firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2Fauto-garage%2FAUTO-Garage-1.png?alt=media&token=0519b2e2-345b-4658-b35c-7fa6e9e70cce",description:"AUTO Garage is a feature rich and a customised software that digitizes the entire process of servicing the heavy vehicles at the client\u2019s service centre. In a nutshell the application involves 6 major stages to document the process from the entry of vehicle to the exit, which is easily accessible through web and as a mobile application. Business operation and customer retention has made a drastic swift with the usage of Auto Garage within the firm. It is a complete business only operation app to eliminate the manual process with a digital management system. The client is an original equipment supplier and has a most reliable service centre for heavy duty vehicles pan India with 62+ service outlets in major cities across the country. For a developed premium service provider there was a need to simplify the end to end vehicle service procedure. Our team developed an application with a tracking system to regulate the sales and services.",challengesFaced:"Manual material gate pass, tedious paper works at multiple level, absence of the approval officers created a distraction in the workflow. Delay in approvals and tracking the labour working hours at the facility was time consuming and cumbersome. Things got complicated when there was raise in material request which was not in the stock. Without a proper communication customer retention was also at stake. All together it lead to the revenue leakage. The challenging factor was to introduce an automated standard operating procedure without affecting the existing working environment. Simplifying and inculcating an intelligent application in the firm was also stimulating."},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2Fauto-garage%2FAUTO-Garage-2.png?alt=media&token=f11508b2-6e73-4b52-a40c-1c7d8e725a73",description:"AUTO Garage is a feature-rich and customized software that digitizes the entire process of servicing heavy vehicles at the client's service center.          It involves 6 major stages, from vehicle entry to exit, and is accessible through both web and mobile applications.          The application improves business operations and customer retention for the client's service center.          It eliminates manual processes and replaces them with a digital management system.          The client is an original equipment supplier with 62+ service outlets across India.          The application simplifies the end-to-end vehicle service procedure and includes a tracking system for sales and services.          Manual material gate pass and tedious paperwork are replaced with automated processes.          Approval workflows are streamlined, reducing delays and improving efficiency.          The tracking of labor working hours is automated, saving time and effort.          The application helps manage material requests and stock availability, improving communication and reducing revenue leakage.          Customer retention is improved through better communication and streamlined processes.          The application was designed to introduce automated standard operating procedures without disrupting the existing working environment.          The aim was to simplify and enhance operations through an intelligent application.          By implementing the AUTO Garage application, the client's service center was able to streamline their processes, improve efficiency, reduce paperwork, and enhance customer satisfaction."}],this.vbmsInfo=[{title:"Vehicle Booking Management System",overview:"Overview",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FVehicle-Booking-Management-System%2FVIMS-1.png?alt=media&token=59d77832-0f87-47ce-af5b-1fa8df7c0a53",description:"Vehicle Booking Management System (VBMS) is designed to make the whole automobile buying process smooth. The full management of quotation, sales invoice, and refund takes place in an organized manner as the client is dealing with high volumes and huge transactions. This also helps to keep track of all vehicles on the showroom premises and will helps us to maintain the data of all customers who have made transactions with us. Also helps us keeping our records, serving our customers better by helping them in all their automotive needs."},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FVehicle-Booking-Management-System%2FVIMS-2.png?alt=media&token=fd1e96a5-66ef-450b-b2fe-36c283be3164",description:""},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FVehicle-Booking-Management-System%2FVIMS-3.png?alt=media&token=3354a8e4-687d-4a47-acee-3607374a9560",description:""},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FVehicle-Booking-Management-System%2FVIMS-4.png?alt=media&token=d07837a2-3f97-4820-a677-ea0a3b8467a8",description:""}],this.roadAssistanceInfo=[{title:"Roadside Assistance",overview:"Overview",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FRoadside-Assistance%2FRSA-1.png?alt=media&token=cc926179-8eb3-43fe-878a-df9b3ab447ed",description:"An achievement of 100+ crore invoice values, 61,700+ Road Side Assistance members with expertise in multiple vehicle services. UITOUX turned their dream into reality with fineness through the portal designed to supervise invoices, subscribers & sales proceeds. With an intent to outstand and to integrate the leading automobile players such as Honda, Renault, Ashok Leyland, Nissan, Bajaj Finance, etc., with their portal to provide RSA; we made it possible for our most valued clientele to take a huge leap on Road Side Assistance."},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FRoadside-Assistance%2FRSA-2.png?alt=media&token=f3987b17-9bdb-4d1b-a022-20b2aefdaa9b",description:""},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FRoadside-Assistance%2FRSA-3.png?alt=media&token=d9372d86-9a80-4365-9b54-501a9995b5e7",description:""},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FRoadside-Assistance%2FRSA-4.png?alt=media&token=8bde94a4-7fb6-481f-8518-3efa0c260f01",description:""}],this.pmsInfo=[{title:"Help Desk",overview:"Overview",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FPMS%2FPMS-1.png?alt=media&token=9379f79f-d680-4309-b555-a8b3be5f7703",description:"Help Desk is a web-based customer service tool that allows you to organize, automate, and deliver all of your support & customer queries in a more efficient and scalable way. With our Help Desk Management software you can turn your customers' issues into business value. Our Help Desk can be used to solve the problems in the application. It will display all the modules in one click. Use the Ticket Tool and Raise Ticket to resolve the problem in the application. A simple and efficient ticket tool can mean the difference for your business. The Help Desk module will enable you to better manage your assets, incidents, services and problems, track performance and help improve the overall efficiency of your projects."},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FPMS%2FPMS-2.png?alt=media&token=6d83c6fd-68e2-49e2-81c7-22eb1d947fad",description:""},{title:"",src:"https://firebasestorage.googleapis.com/v0/b/vigneshvasanthportfolio.appspot.com/o/project-img%2FPMS%2FPMS-3.png?alt=media&token=c2c5c91f-26ba-4832-8bb2-b3bf7de330f5",description:""},{